import React from 'react'

const TodoForm = () => {
  return (
    <div>

      <form className='TodoForm'>
        <input type="text" className="toto-input" placeholder='What is the task today'/>
        <button type='submit' className='todo-btn'></button>

      </form>
      
    </div>
  )
}

export default TodoForm
